import {useSpring, animated} from 'react-spring'
import {Spring} from 'react-spring/web.cjs'

function Gallery() {
    return (
        <Spring
  from={{ number: 0 }}
  to={{ number: 1 }}>
  {props => <div>{props.number}</div>}
</Spring>
    )
}

export default Gallery;
